pragma solidity ^0.6.2;

library Console {
    function getFive() public pure returns(uint ){
        return 5;
    }
}

contracts/Escrow.sol.content:
pragma solidity ^0.6.2;

import "./Console.sol";

contract EscrowContract {
	uint public x;

	constructor() public {
		x = Console.getFive();
	}
}
